import Menu from '../components/Menu';
import Head from 'next/head';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Container } from 'reactstrap';

function HomePage() {
    return (
        <div>
            <Head>
                <title>
                    Home - Site Filipe
                </title>
                <meta name='description'
                    content='Site simples desenvolvido por filipe o qual utiliza React e Next'
                />
                <meta name='author'
                    content='Filipe'
                />

            </Head>

            <Menu />
            <Jumbotron fluid>
                <Container className='text-center'>
                    <h1 className='display-4'>Texto exemplo Titulo</h1>
                    <p className='lead'>Informações referentes ao site - classe jumbotrom, importa e utiliza.</p>
                </Container>

            </Jumbotron>
        </div>
    );
}

export default HomePage
